script: |
  super -f text -I q2334.spq | sort > q2334.out

inputs:
  - name: q2334.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + 26 / + - 51 - + col1 NOT IN ( col0, col2, + - col0 - - 83, col0 );
  - name: tab2

outputs:
  - name: q2334.out
    data: |
      46	51	23
      64	77	40
      75	67	58
